import React from "react";
import { BaseElemetPropsType } from "../../../UI/BaseElemetPropsType";
type treeLinkType = BaseElemetPropsType & { href: string };

export default function TreeLink(props: treeLinkType) {
	return (
		<a {...props} className="tree-link" key={props.id}>
			{props.title}
		</a>
	);
}
